const Navbar = () => {

    function HandleChange() {
        console.log("Hello");
    }

    return ( 
        <nav className="navbar">
            <h1>The Dojo Blog</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create">New Blog</a>
                <button onClick={HandleChange}>Login</button>
            </div>
        </nav>
     );
}

export default Navbar;
